import USER from "./mockUserData";

export default function UserDataPage() {
  let firstUser = USER[0];
  let name = USER.name;
  let username = USER.username;
  let email = USER.email;
  let imgURL = USER.profile_pic_url;
  return (
    <>
      <h1>{username}'s Profile Page</h1>
      <p>
        {name}
        {email}
      </p>
      <img src={imgURL} />
    </>
  );
}
